import logo from './logo.svg';
import './App.css';
import CompCreateSpiral from './spiral/createSpiral';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <CompCreateSpiral></CompCreateSpiral>
    </div>
  );
}

export default App;
